      thumbnail="https://placekitten.com/80/60?image=2"
      width="1024"
      height="768"
    >
      {({ ref, open }) => (
        <img ref={ref} onClick={open} src="https://placekitten.com/80/60?image=2" />
       
      )}
    </Item>
    </CustomGallery>

    <DefaultLayout
      shareButton={false}
      fullscreenButton={true}
      zoomButton={true}
      ref={layoutRef}
    />
    </Flex>
  )
}
